//  Wave math 
const TOTAL_W = 6000;
const SVG_H = 500;
const PAD_X = 80;
const LANE_TOP = 50;
const LANE_BOT = 450;
const N_SEG = 48;

// DNA-like helix: each line is a big sinusoid, phase-shifted so they interweave
// Phase offsets spread 4 lines evenly across a full cycle
const PHASE_OFFSETS = [0, Math.PI * 0.5, Math.PI, Math.PI * 1.5];
// How many full oscillations fit across the entire timeline width
const HELIX_FREQ = 8;
// Amplitude as fraction of vertical zone (0..1): 0.42 means lines sweep ~84% of the zone
const HELIX_AMP = 0.42;

function eventT(ev) {
  const pi = PERIODS.findIndex((p) => p.id === ev.periodId);
  const evs = EVENTS.filter((e) => e.periodId === ev.periodId);
  const ei = evs.indexOf(ev);
  const s = pi / PERIODS.length;
  const e = (pi + 1) / PERIODS.length;
  return s + ((ei + 1) / (evs.length + 1)) * (e - s);
}

// For multi-theme events, we still converge lines at those points
function buildIntersections() {
  const m = {};
  EVENTS.forEach((ev) => {
    if (ev.themes.length <= 1) return;
    const t = eventT(ev);
    const seg = Math.round(t * N_SEG);
    m[seg] = { y: 0.5, themes: ev.themes, id: ev.id };
  });
  return m;
}
const IXNS = buildIntersections();

function genWave(ti, time) {
  const zH = LANE_BOT - LANE_TOP;
  const tk = THEME_KEYS[ti];
  const phase = PHASE_OFFSETS[ti];
  const pts = [];
  for (let i = 0; i <= N_SEG; i++) {
    const x = PAD_X + (i / N_SEG) * (TOTAL_W - PAD_X * 2);
    const t = i / N_SEG;

    // Primary helix wave
    const mainWave = Math.sin(t * Math.PI * 2 * HELIX_FREQ + phase + time * 0.4);
    // Secondary wobble for organic feel
    const wobble = Math.sin(t * Math.PI * 2 * 3.3 + ti * 1.7 + time * 0.25) * 0.06;

    let ny = 0.5 + mainWave * HELIX_AMP + wobble;

    // Converge at intersection points
    for (let d = -3; d <= 3; d++) {
      const ix = IXNS[i + d];
      if (ix && ix.themes.includes(tk)) {
        const dist = Math.abs(d);
        const strength = dist === 0 ? 0.85 : dist === 1 ? 0.6 : dist === 2 ? 0.3 : 0.12;
        ny = ny * (1 - strength) + ix.y * strength;
      }
    }

    ny = Math.max(0.03, Math.min(0.97, ny));
    pts.push({ x, y: LANE_TOP + ny * zH });
  }
  return pts;
}

function toPath(pts) {
  if (pts.length < 2) return "";
  let d = `M ${pts[0].x.toFixed(1)},${pts[0].y.toFixed(1)}`;
  for (let i = 0; i < pts.length - 1; i++) {
    const p0 = pts[Math.max(i - 1, 0)], p1 = pts[i], p2 = pts[i + 1], p3 = pts[Math.min(i + 2, pts.length - 1)];
    d += ` C ${(p1.x + (p2.x - p0.x) / 6).toFixed(1)},${(p1.y + (p2.y - p0.y) / 6).toFixed(1)} ${(p2.x - (p3.x - p1.x) / 6).toFixed(1)},${(p2.y - (p3.y - p1.y) / 6).toFixed(1)} ${p2.x.toFixed(1)},${p2.y.toFixed(1)}`;
  }
  return d;
}

function lerp(pts, t) {
  const idx = t * (pts.length - 1);
  const i = Math.max(0, Math.min(Math.floor(idx), pts.length - 2));
  const f = idx - i;
  return { x: pts[i].x + (pts[i + 1].x - pts[i].x) * f, y: pts[i].y + (pts[i + 1].y - pts[i].y) * f };
}

//  Components 
function Preloader({ onDone }) {
  const [p, setP] = useState(0);
  const done = useRef(false);
  useEffect(() => {
    const iv = setInterval(() => {
      setP((v) => { if (v >= 100) { clearInterval(iv); if (!done.current) { done.current = true; onDone(); } return 100; } return v + 2; });
    }, 30);
    return () => clearInterval(iv);
  }, []);
  return (
    <div style={{ position: "fixed", inset: 0, zIndex: 9999, background: "#0a0a0f", display: "flex", flexDirection: "column", alignItems: "center", justifyContent: "center" }}>
      <div style={{ fontFamily: "'DM Serif Display', serif", fontSize: 36, color: "#fff", marginBottom: 8, letterSpacing: 1 }}>Constructor University</div>
      <div style={{ fontFamily: "'Space Mono', monospace", fontSize: 13, color: "#888", marginBottom: 30, letterSpacing: 3, textTransform: "uppercase" }}>Timeline of History</div>
      <div style={{ width: 240, height: 3, background: "#222", borderRadius: 2, overflow: "hidden" }}>
        <div style={{ width: `${p}%`, height: "100%", background: "linear-gradient(90deg, #E2B628, #2E6FD6, #D63A3A, #2EAA5E)", transition: "width 0.1s" }} />
      </div>
      <div style={{ fontFamily: "'Space Mono', monospace", fontSize: 11, color: "#555", marginTop: 12 }}>{p}%</div>
    </div>
  );
}

function EventModal({ event, onClose }) {
  if (!event) return null;
  return (
    <div onClick={onClose} style={{ position: "fixed", inset: 0, zIndex: 1000, background: "rgba(0,0,0,0.7)", backdropFilter: "blur(8px)", display: "flex", alignItems: "center", justifyContent: "center", animation: "fadeIn 0.3s ease" }}>
      <div onClick={(e) => e.stopPropagation()} style={{ background: "#141419", border: "1px solid #2a2a35", borderRadius: 16, maxWidth: 560, width: "90%", maxHeight: "85vh", overflow: "auto", position: "relative", animation: "slideUp 0.35s ease" }}>
        <img src={event.image} alt={event.title} style={{ width: "100%", height: 220, objectFit: "cover", borderRadius: "16px 16px 0 0" }} />
        <button onClick={onClose} style={{ position: "absolute", top: 12, right: 12, width: 36, height: 36, borderRadius: "50%", background: "rgba(0,0,0,0.6)", border: "none", color: "#fff", fontSize: 18, cursor: "pointer", display: "flex", alignItems: "center", justifyContent: "center" }}></button>
        <div style={{ padding: "24px 28px 28px" }}>
          <div style={{ display: "flex", gap: 8, marginBottom: 12, flexWrap: "wrap" }}>
            {event.themes.map((t) => (
              <span key={t} style={{ fontSize: 11, fontFamily: "'Space Mono', monospace", padding: "3px 10px", borderRadius: 20, background: THEMES[t].color + "22", color: THEMES[t].color, border: `1px solid ${THEMES[t].color}44`, textTransform: "uppercase", letterSpacing: 1 }}>{THEMES[t].label}</span>
            ))}
          </div>
          <div style={{ fontFamily: "'Space Mono', monospace", fontSize: 13, color: "#666", marginBottom: 6 }}>{event.year}</div>
          <h2 style={{ fontFamily: "'DM Serif Display', serif", fontSize: 26, color: "#fff", margin: "0 0 16px", lineHeight: 1.3 }}>{event.title}</h2>
          <p style={{ fontFamily: "'DM Sans', sans-serif", fontSize: 15, color: "#aaa", lineHeight: 1.7, margin: 0 }}>{event.description}</p>
        </div>
      </div>
    </div>
  );
}

function ThemeLegend({ active, onToggle }) {
  return (
    <div style={{ position: "fixed", top: 20, left: 20, zIndex: 100, display: "flex", gap: 10, flexWrap: "wrap" }}>
      {THEME_KEYS.map((k) => {
        const on = active.includes(k);
        return (
          <button key={k} onClick={() => onToggle(k)} style={{
            fontFamily: "'Space Mono', monospace", fontSize: 11, padding: "6px 14px", borderRadius: 20, cursor: "pointer",
            background: on ? THEMES[k].color + "22" : "#1a1a22", color: on ? THEMES[k].color : "#555",
            border: `1px solid ${on ? THEMES[k].color + "66" : "#333"}`, transition: "all 0.3s", textTransform: "uppercase", letterSpacing: 1,
          }}>
            <span style={{ display: "inline-block", width: 8, height: 8, borderRadius: "50%", background: on ? THEMES[k].color : "#444", marginRight: 8 }} />
            {THEMES[k].label}
          </button>
        );
      })}
    </div>
  );
}

//  Main 
export default function App() {
  const [loaded, setLoaded] = useState(false);
  const [sel, setSel] = useState(null);
  const [active, setActive] = useState([...THEME_KEYS]);
  const [time, setTime] = useState(0);
  const [hov, setHov] = useState(null);
  const [autoHint, setAutoHint] = useState(null);
  const scrollRef = useRef(null);
  const [scrollX, setScrollX] = useState(0);

  useEffect(() => {
    let raf;
    const tick = () => { setTime((t) => t + 0.004); raf = requestAnimationFrame(tick); };
    raf = requestAnimationFrame(tick);
    return () => cancelAnimationFrame(raf);
  }, []);

  const onWheel = useCallback((e) => {
    if (scrollRef.current) { e.preventDefault(); scrollRef.current.scrollLeft += e.deltaY + e.deltaX; }
  }, []);

  useEffect(() => {
    const el = scrollRef.current;
    if (el) { el.addEventListener("wheel", onWheel, { passive: false }); return () => el.removeEventListener("wheel", onWheel); }
  }, [onWheel, loaded]);

  const onScroll = useCallback(() => { if (scrollRef.current) setScrollX(scrollRef.current.scrollLeft); }, []);

  const waves = useMemo(() =>
    THEME_KEYS.map((k, i) => {
      const pts = genWave(i, time);
      return { key: k, pts, d: toPath(pts) };
    }), [time]);

  const pins = useMemo(() =>
    EVENTS.map((ev) => {
      const t = eventT(ev);
      const pt = lerp(waves[THEME_KEYS.indexOf(ev.themes[0])].pts, t);
      return { ...ev, x: pt.x, y: pt.y, t };
    }), [waves]);

  const pMarkers = PERIODS.map((p, i) => ({
    ...p, x: PAD_X + (i / PERIODS.length) * (TOTAL_W - PAD_X * 2),
    xEnd: PAD_X + ((i + 1) / PERIODS.length) * (TOTAL_W - PAD_X * 2),
  }));

  const toggle = (k) => setActive((p) => p.includes(k) ? p.filter((x) => x !== k) : [...p, k]);

  const goTo = (i) => {
    if (scrollRef.current) {
      const x = PAD_X + (i / PERIODS.length) * (TOTAL_W - PAD_X * 2) - 100;
      scrollRef.current.scrollTo({ left: Math.max(0, x), behavior: "smooth" });
    }
  };

  const aIdx = Math.min(PERIODS.length - 1, Math.max(0, Math.floor(((scrollX + 100) / (TOTAL_W - PAD_X * 2)) * PERIODS.length)));

  // Auto-show tooltip for first pin when scrolling into a new period
  const prevPeriodRef = useRef(-1);
  const autoTimerRef = useRef(null);
  useEffect(() => {
    if (aIdx === prevPeriodRef.current) return;
    prevPeriodRef.current = aIdx;

    if (hov) return;

    // Clear any existing timers
    if (autoTimerRef.current) clearTimeout(autoTimerRef.current);

    // Small delay so it appears after entering the period
    const delayTimer = setTimeout(() => {
      const periodId = PERIODS[aIdx].id;
      const periodEvents = EVENTS.filter((e) => e.periodId === periodId);
      const lastEv = periodEvents[periodEvents.length - 1];
      if (lastEv) {
        setAutoHint(lastEv.id);
        autoTimerRef.current = setTimeout(() => setAutoHint(null), 5000);
      }
    }, 400);

    return () => {
      clearTimeout(delayTimer);
      if (autoTimerRef.current) clearTimeout(autoTimerRef.current);
    };
  }, [aIdx]);

  if (!loaded) return <Preloader onDone={() => setLoaded(true)} />;

  return (
    <div style={{ background: "#0a0a0f", minHeight: "100vh", overflow: "hidden", fontFamily: "'DM Sans', sans-serif", color: "#fff", position: "relative" }}>
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=DM+Sans:wght@300;400;500&family=DM+Serif+Display&family=Space+Mono:wght@400;700&display=swap');
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { overflow: hidden; background: #0a0a0f; }
        @keyframes fadeIn { from { opacity: 0 } to { opacity: 1 } }
        @keyframes slideUp { from { opacity: 0; transform: translateY(30px) } to { opacity: 1; transform: translateY(0) } }
        ::-webkit-scrollbar { display: none; }
      `}</style>

      {/* Top gradient backdrop */}
      <div style={{ position: "fixed", top: 0, left: 0, right: 0, height: 60, zIndex: 49, pointerEvents: "none", background: "linear-gradient(rgba(0,0,0,0.6), transparent)" }} />

      {/* Period title below gradient */}
      <div style={{ position: "fixed", top: 65, left: 0, right: 0, textAlign: "center", zIndex: 50, pointerEvents: "none" }}>
        <div style={{ fontFamily: "'Space Mono', monospace", fontSize: 13, color: "#fff", letterSpacing: 4, textTransform: "uppercase", marginBottom: 4 }}>{PERIODS[aIdx].year}</div>
        <div style={{ fontFamily: "'DM Serif Display', serif", fontSize: 32, color: "#fff", opacity: 0.85, letterSpacing: 2 }}>{PERIODS[aIdx].title}</div>
      </div>

      <ThemeLegend active={active} onToggle={toggle} />

      <div ref={scrollRef} onScroll={onScroll} style={{ width: "100vw", height: "100vh", overflowX: "auto", overflowY: "hidden" }}>
        <div style={{ width: TOTAL_W, height: "100vh", position: "relative" }}>

          {/* Period gradient background */}
          <div style={{
            position: "absolute", inset: 0, zIndex: 0,
            background: `linear-gradient(to right, ${PERIOD_COLORS.map((c, i) => `${c} ${(i / (PERIOD_COLORS.length - 1)) * 100}%`).join(", ")})`,
          }} />

          {pMarkers.map((p, i) => (
            <div key={p.id} style={{ position: "absolute", left: p.x, top: 0, width: p.xEnd - p.x, height: "100%", borderLeft: i > 0 ? "1px dashed #1a1a25" : "none" }}>
              <div style={{ position: "absolute", bottom: 100, left: 20, fontFamily: "'Space Mono', monospace", fontSize: 11, color: "#333", letterSpacing: 2, textTransform: "uppercase", writingMode: "vertical-rl", transform: "rotate(180deg)" }}>{p.year}</div>
            </div>
          ))}

          <svg width={TOTAL_W} height={SVG_H + 260} viewBox={`0 -260 ${TOTAL_W} ${SVG_H + 260}`} style={{ position: "absolute", top: "calc(50% - 510px)", left: 0, overflow: "visible" }}>

            {/* Theme lines */}
            {waves.map(({ key, d }) => {
              const on = active.includes(key);
              return (
                <g key={key}>
                  <path d={d} fill="none" stroke={THEMES[key].color} strokeWidth={8} opacity={on ? 0.08 : 0} />
                  <path d={d} fill="none" stroke={THEMES[key].color} strokeWidth={on ? 2.5 : 0.7} opacity={on ? 0.65 : 0.1} strokeLinecap="round" style={{ transition: "opacity 0.5s, stroke-width 0.5s" }} />
                </g>
              );
            })}

            {/* Pins on lines */}
            {pins.map((ev) => {
              const vis = ev.themes.some((t) => active.includes(t));
              const multi = ev.themes.length > 1;
              const r = multi ? 9 : 6;
              const isAutoHint = autoHint === ev.id;
              const isH = hov === ev.id || isAutoHint;
              const pc = THEMES[ev.themes[0]].color;
              const sc = isH ? 1.6 : 1;

              // For auto-hint: scale tooltip based on distance from viewport center
              const viewW = typeof window !== "undefined" ? window.innerWidth : 1200;
              const pinScreenX = ev.x - scrollX;
              const centerDist = Math.min(1, Math.abs(pinScreenX - viewW / 2) / (viewW / 2));
              // Smooth easing: cubic for more natural feel
              const easedDist = centerDist * centerDist;
              const hintScale = isAutoHint ? 0.3 + (1 - easedDist) * 0.7 : 1;
              const hintOpacity = isAutoHint ? Math.max(0.1, hintScale * hintScale) : 1;

              return (
                <g key={ev.id} style={{ cursor: "pointer" }} onClick={() => setSel(ev)} onMouseEnter={() => { setHov(ev.id); setAutoHint(null); }} onMouseLeave={() => setHov(null)}>

                  {/* Animated pulse ring */}
                  {vis && (
                    <circle cx={ev.x} cy={ev.y} r={r} fill="none" stroke={pc} strokeWidth={0.8} opacity={0}>
                      <animate attributeName="r" from={r} to={r + 16} dur="2.5s" repeatCount="indefinite" />
                      <animate attributeName="opacity" from="0.5" to="0" dur="2.5s" repeatCount="indefinite" />
                    </circle>
                  )}

                  {multi ? (
                    /* Multi-theme pin: dark center with colored concentric rings */
                    <g transform={`translate(${ev.x},${ev.y}) scale(${sc})`} style={{ transformOrigin: "0 0", transition: "transform 0.2s" }}>
                      <circle cx={0} cy={0} r={r} fill="#0f0f18" stroke={pc} strokeWidth={2} opacity={vis ? 1 : 0.12} />
                      {ev.themes.map((tk, ti) => (
                        <circle key={tk} cx={0} cy={0} r={r - 2 - ti * 2} fill="none" stroke={THEMES[tk].color} strokeWidth={1.8} opacity={vis ? 0.9 : 0.1} />
                      ))}
                      <circle cx={0} cy={0} r={1.5} fill="#fff" opacity={vis ? 0.85 : 0.1} />
                    </g>
                  ) : (
                    /* Single-theme pin: solid dot */
                    <circle cx={ev.x} cy={ev.y} r={r * sc} fill={pc} stroke="#0a0a0f" strokeWidth={2}
                      opacity={vis ? 1 : 0.1}
                      style={{ transition: "r 0.2s, opacity 0.4s" }}
                    />
                  )}

                  {/* Hover tooltip with thumbnail */}
                  {isH && vis && (
                    <foreignObject
                      x={ev.x - 150}
                      y={ev.y - r * sc - 260}
                      width={300}
                      height={250}
                      style={{ pointerEvents: "none", overflow: "visible" }}
                    >
                      <div xmlns="http://www.w3.org/1999/xhtml" style={{
                        transform: `scale(${hintScale})`,
                        opacity: hintOpacity,
                        transformOrigin: "bottom center",
                        transition: "transform 0.3s ease-out, opacity 0.3s ease-out",
                      }}>
                        <div style={{
                          background: "#16161f", border: "1px solid #2a2a38", borderRadius: 10,
                          overflow: "hidden", boxShadow: "0 8px 32px rgba(0,0,0,0.5)",
                        }}>
                          <img src={ev.image} alt="" style={{ width: "100%", display: "block", borderRadius: "10px 10px 0 0" }} />
                          <div style={{ padding: "10px 14px 12px" }}>
                            <div style={{ display: "flex", alignItems: "center", gap: 6, marginBottom: 4 }}>
                              <span style={{ fontFamily: "'Space Mono', monospace", fontSize: 10, color: "#777" }}>{ev.year}</span>
                              {ev.themes.map((tk) => (
                                <span key={tk} style={{ width: 7, height: 7, borderRadius: "50%", background: THEMES[tk].color, display: "inline-block" }} />
                              ))}
                            </div>
                            <div style={{ fontFamily: "'DM Sans', sans-serif", fontSize: 13, fontWeight: 500, color: "#eee", lineHeight: 1.3 }}>
                              {ev.title}
                            </div>
                          </div>
                        </div>
                      </div>
                    </foreignObject>
                  )}
                </g>
              );
            })}
          </svg>
        </div>
      </div>

      {/* Bottom nav */}
      <div style={{ position: "fixed", bottom: 0, left: 0, right: 0, zIndex: 100, background: "linear-gradient(transparent, rgba(0,0,0,0.6) 40%, rgba(0,0,0,0.8))", padding: "40px 20px 24px" }}>
        <div style={{ display: "flex", justifyContent: "center", gap: 0, maxWidth: 900, margin: "0 auto" }}>
          {PERIODS.map((p, i) => {
            const on = i === aIdx;
            return (
              <button key={p.id} onClick={() => goTo(i)} style={{ flex: 1, background: "none", border: "none", cursor: "pointer", padding: "10px 8px", borderBottom: `2px solid ${on ? "#fff" : "#222"}`, transition: "all 0.3s" }}>
                <div style={{ fontFamily: "'Space Mono', monospace", fontSize: 11, color: on ? "#fff" : "#444", letterSpacing: 1, marginBottom: 2, transition: "color 0.3s" }}>{p.year}</div>
                <div style={{ fontFamily: "'DM Serif Display', serif", fontSize: 13, color: on ? "#ccc" : "#333", transition: "color 0.3s", whiteSpace: "nowrap", overflow: "hidden", textOverflow: "ellipsis" }}>{p.title}</div>
              </button>
            );
          })}
        </div>
      </div>

      <EventModal event={sel} onClose={() => setSel(null)} />
    </div>
  );
}
